import React from 'react';
import { persons } from './persons'

const Card = () => {
	return (
		<div className='bg-light-green dib br3 pa3 ma2 grow bw2 shadow-5'>
			<h2>Name: {persons[0].name}</h2>
			<p>Age: {persons[0].age}</p>
			<p>Gender: {persons[0].gender}</p>
		</div>
	)
}

export default Card;
